import React, { useState, useEffect, useRef } from "react";
import analysis from "../images/medical-analysis.jpeg"
const { tableau } = window;


function Scenario2(){
  const url = 'https://public.tableau.com/views/Medical_16847518861770/Dashboard2';
  const ref = useRef(null);

  const initViz = () => {
    new tableau.Viz(ref.current, url, {
      width: "100%",
      height: "100%"
    });
  };

  useEffect(initViz, []);

  return (
    <div className="embed">
      <h1 className="embed_heading">Medical expenditure rates in Melbourne</h1>
      <div className="viz-container" ref={ref} />
      <div className="content">
      <h1 className="content_heading">Scenario Analysis</h1>
       <div className="image-container">
          <img className="image" src={analysis} alt="Image 1" />
          <p className="image-description"><br></br>Here, you can see the bottom 5 cities and their respective average sentiments based on the twitter sentiment analysis that was conducted. 

<br></br><br></br>We observe that the highest prices in Melbourne are in Dandenong and Dandenong North.

<br></br><br></br>From our analysis of average sentiments, we observe negative sentiments coming from Packenham which is close to Dandenong. 

<br></br><br></br>This implies that suburbs with negative average sentiments tend to have higher average Medicare rates suggesting that people in Melbourne are not happy about Medicare prices.</p>
      </div> 
      </div>
    </div>
  );
}


export default Scenario2;
